import React from 'react';
import '../scss/EnConstruction.scss';
import logo from '../image/Logo.png';

function DonneesPersonnelles() {
  return (
    <div className="en-construction-container">
      <img src={logo.png} alt="En construction" className="construction-image" />
      <h1>Donnes personnelles</h1>
      <h2>Page en cours de construction</h2>
      <p>Cette page sera disponible prochainement. Merci de votre patience.</p>
    </div>
  );
}

export default DonneesPersonnelles;
